import React from 'react';
import Header from '../component/Header';

class Search extends React.Component {
  render() {
    return (
      <div data-testid="page-search">
        <Header />
        <form class="form-inline">
          <div className="form-group mx-sm-3 mb-2">
            <label for="staticEmail2" className="sr-only">
              <input type="text" readonly className="form-control" id="staticEmail2" value="email@exemplo.com"/>
            </label>
          </div>
          <button type="submit" className="btn btn-primary mb-2">Confirmar identidade</button>
        </form>
      </div>
    );
  }
}

export default Search;
